import React, { useState } from 'react';

const initialProfile = {
  firstName: 'Nagasiva',
  lastName: '',
  headline: '',
  bio: '',
  email: 'nagasivakumari26@gmail.com',
  website: '',
  facebook: '',
  instagram: '',
  linkedin: '',
  tiktok: '',
  x: '',
  youtube: '',
};

const Profile: React.FC = () => {
  const [profile, setProfile] = useState(initialProfile);
  const [saved, setSaved] = useState(false);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setProfile((prev) => ({ ...prev, [name]: value }));
    setSaved(false);
  };

  const handleSave = (e: React.FormEvent) => {
    e.preventDefault();
    setSaved(true);
    // Here you would send the updated profile to your backend
  };

  return (
    <div className="section">
      <div className="container" style={{ maxWidth: 700, margin: '0 auto' }}>
        <h1 className="section-title">Public Profile</h1>
        <form onSubmit={handleSave}>
          <div className="grid grid-2" style={{ gap: '2rem' }}>
            <div>
              <label className="form-label">First Name</label>
              <input className="form-input" name="firstName" value={profile.firstName} onChange={handleChange} />
            </div>
            <div>
              <label className="form-label">Last Name</label>
              <input className="form-input" name="lastName" value={profile.lastName} onChange={handleChange} />
            </div>
          </div>
          <div className="form-group">
            <label className="form-label">Headline</label>
            <input className="form-input" name="headline" value={profile.headline} onChange={handleChange} maxLength={60} placeholder="e.g. Blockchain Developer" />
          </div>
          <div className="form-group">
            <label className="form-label">Bio</label>
            <textarea className="form-input" name="bio" value={profile.bio} onChange={handleChange} rows={4} placeholder="Tell us about yourself..." />
          </div>
          <div className="form-group">
            <label className="form-label">Email</label>
            <input className="form-input" name="email" value={profile.email} onChange={handleChange} type="email" />
          </div>
          <div className="form-group">
            <label className="form-label">Website</label>
            <input className="form-input" name="website" value={profile.website} onChange={handleChange} placeholder="https://yourwebsite.com" />
          </div>
          <h3 style={{ margin: '2rem 0 1rem' }}>Social Links</h3>
          <div className="grid grid-2" style={{ gap: '2rem' }}>
            <input className="form-input" name="facebook" value={profile.facebook} onChange={handleChange} placeholder="Facebook username" />
            <input className="form-input" name="instagram" value={profile.instagram} onChange={handleChange} placeholder="Instagram username" />
            <input className="form-input" name="linkedin" value={profile.linkedin} onChange={handleChange} placeholder="LinkedIn profile URL" />
            <input className="form-input" name="tiktok" value={profile.tiktok} onChange={handleChange} placeholder="TikTok username" />
            <input className="form-input" name="x" value={profile.x} onChange={handleChange} placeholder="X (Twitter) username" />
            <input className="form-input" name="youtube" value={profile.youtube} onChange={handleChange} placeholder="YouTube username" />
          </div>
          <button type="submit" className="btn btn-primary" style={{ marginTop: '2rem', width: 200 }}>
            Save
          </button>
          {saved && <span style={{ color: 'green', marginLeft: '1rem' }}>Profile saved!</span>}
        </form>
      </div>
    </div>
  );
};

export default Profile;
